### For Fly Super 8 V1.3 ####
### And Mellow Kit  ####
### For Fly Super pro 8, the SPI bus is spi1A
### For Fly Super 8 V1.3, the SPI bus is spi3
# Day profile

[include mainsail.cfg]
# [include timelapse.cfg]
[include exclude_object.cfg]
[include macro.cfg]
[include led.cfg]
#[include macro_day.cfg]
# [include speed.cfg]
#[include adxl345.cfg]
[include KAMP_Settings.cfg]
[include beacon.cfg]
[include shell_command.cfg]
[include sound.cfg]

[display_status]
[exclude_object]
[virtual_sdcard]
path: ~/printer_data/gcodes # UPDATE THIS FOR YOUR PATH!!!
on_error_gcode: CANCEL_PRINT

########################
##### VzBoT ############
########################

[printer]
kinematics: corexy
max_velocity: 2000
max_accel: 14900
# max_accel_to_decel: 15000
max_z_velocity: 10
max_z_accel: 150
square_corner_velocity: 5


#######################
##### Steppers ########
#######################

########################
########################
##
## M0 position might be broken, I use it for Z, but break it, now Z is in M1
## M7 has some issueâ€™s with SPI according to https://docs.vzbot.org/vz330_mellow/electronics/super_mellow
## 
########################
########################

[stepper_x]
# in M2 position
step_pin: PE4
dir_pin: PG0
enable_pin: !PG1
rotation_distance: 40
microsteps: 16
full_steps_per_rotation: 200  
endstop_pin: PG9 # IO2 PG11 is broken
position_endstop: 0
position_min: 0
position_max: 337 # Never larger than 337 for my vzbot
homing_speed: 100
homing_retract_dist: 0

[tmc5160 stepper_x] 
# in M2 position
#spi_bus: spi3
cs_pin: PF15
#diag_pin: PA8
interpolate: false
sense_resistor: 0.033
spi_software_mosi_pin: PB5
spi_software_miso_pin: PB4
spi_software_sclk_pin: PB3

[stepper_x1]
# in M4 position
step_pin: PE15
dir_pin: !PE11
enable_pin: !PF2
rotation_distance: 40
microsteps: 16
full_steps_per_rotation: 200
#endstop_pin: tmc5160_stepper_x:virtual_endstop 

[tmc5160 stepper_x1]
# in M4 position
#spi_bus: spi3
cs_pin: PE10
#diag_pin: PD6
interpolate: false
sense_resistor: 0.033
spi_software_mosi_pin: PB5
spi_software_miso_pin: PB4
spi_software_sclk_pin: PB3

[stepper_y]
# in M5 position
step_pin: PE1
dir_pin: PF0
enable_pin: !PC15
rotation_distance: 40
microsteps: 16
full_steps_per_rotation: 200  
endstop_pin: PG12                 # make sure to set the correct pin here.
position_endstop: 0
position_min: 0
position_max: 285                 # 320 will move nozzle to the bed back-side metal part.
homing_speed: 100 
homing_retract_dist: 0

[tmc5160 stepper_y] 
# in M5 position
#spi_bus: spi3
cs_pin: PF1
#diag_pin: PD7
interpolate: false
sense_resistor: 0.033
spi_software_mosi_pin: PB5
spi_software_miso_pin: PB4
spi_software_sclk_pin: PB3

[stepper_y1]
# in M6 position
step_pin: PE0
dir_pin: PG3
enable_pin: !PG4
rotation_distance: 40
microsteps: 16
full_steps_per_rotation: 200
#endstop_pin: tmc5160_stepper_y:virtual_endstop  

[tmc5160 stepper_y1] 
# in M6 position
#spi_bus: spi3
cs_pin: PG2
#diag_pin: PG9
interpolate: false
sense_resistor: 0.033
spi_software_mosi_pin: PB5
spi_software_miso_pin: PB4
spi_software_sclk_pin: PB3

[stepper_z]
## In M1 position
step_pin: PE3
dir_pin: PF13
enable_pin: !PF14
microsteps: 32
rotation_distance: 1
position_min: -2.0
position_max: 400
full_steps_per_rotation: 200
homing_positive_dir: false
#endstop_pin: PG10           #make sure to set the correct pin here.
#homing_retract_dist: 5.0
endstop_pin: probe:z_virtual_endstop # use beacon as virtual endstop
homing_retract_dist: 0 # beacon needs this to be set to 0
homing_speed: 30.0
second_homing_speed: 5.0

[tmc2209 stepper_z]
## In M1 position
uart_pin: PF12
interpolate: true

[tmc5160 stepper_x] 
run_current: 2.000
#driver_SGT: -64 # -64 is most sensitive value, 63 is least sensitive
driver_TBL: 1
driver_TOFF: 3
driver_DISS2G: 1
driver_DISS2VS: 1
stealthchop_threshold: 0

[tmc5160 stepper_x1] 
run_current: 2.000
#driver_SGT: -64 # -64 is most sensitive value, 63 is least sensitive
driver_TBL: 1
driver_TOFF: 3
driver_DISS2G: 1
driver_DISS2VS: 1
stealthchop_threshold: 0

[tmc5160 stepper_y] 
run_current: 2.000
#driver_SGT: -64 # -64 is most sensitive value, 63 is least sensitive
driver_TBL: 1
driver_TOFF: 3
driver_DISS2G: 1
driver_DISS2VS: 1
stealthchop_threshold: 0

[tmc5160 stepper_y1] 
run_current: 2.000
#driver_SGT: -64 # -64 is most sensitive value, 63 is least sensitive
driver_TBL: 1
driver_TOFF: 3
driver_DISS2G: 1
driver_DISS2VS: 1
stealthchop_threshold: 0

[tmc2209 stepper_z]
run_current: 1.000
stealthchop_threshold: 9999999

[extruder]
## In M3 position
### Orbiterv2
### https://trianglelab.net/u_file/2112/11/file/Orbiterv20FirmwareConfiguration-031c.pdf
step_pin: PE14
dir_pin: PE8
enable_pin: !PE9
microsteps: 16
rotation_distance: 4.637
#Gear_ratio: 50:8
nozzle_diameter: 0.4
filament_diameter: 1.750
full_steps_per_rotation: 200
max_extrude_only_distance: 500.0
max_extrude_cross_section: 80
max_extrude_only_velocity: 120
max_extrude_only_accel: 10000
min_extrude_temp: 0
pressure_advance: 0.02
pressure_advance_smooth_time: 0.02
heater_pin: PB0
# sensor_type: EPCOS 100K B57560G104F
sensor_type: PT1000
sensor_pin: PF4
# pullup_resistor: 2960
min_temp: 0
max_temp: 360

[verify_heater extruder] 
check_gain_time: 2000
max_error: 2000
hysteresis: 50
heating_gain: 1

[tmc2209 extruder]
## In M3 position
uart_pin: PE7
interpolate: true
run_current: 0.85
sense_resistor: 0.110
stealthchop_threshold: 0
driver_TBL: 0
driver_HEND: 6
driver_HSTRT: 7
driver_TOFF: 4

# [tmc2209 extruder]
# ## In M3 position
# uart_pin: PE7
# interpolate: true
# run_current: 0.85
# sense_resistor: 0.110
# stealthchop_threshold: 9999999

#########################

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32h723xx_4A0018001651313338343730-if00
#restart_method: command

[mcu rpi]
serial: /tmp/klipper_host_mcu

[pause_resume]
recover_velocity: 200

# Enable arcs support for Orcaslicer.
[gcode_arcs]
resolution: 0.1

# does not compatible with beacon
